import React from "react";
import "./Login.css";
import logo from "./../../images/logo.png";

function Login() {
  return (
    <div className="main">
      <div className="login">
        <img className="logo" alt="logo" src={logo}></img>
        <div className="login--main"></div>
      </div>
    </div>
  );
}

export default Login;
